insert  into `item_description`(`id`,`tag`,`value`,`item_id`) values 
(608,'Description','<span>Apple is an edible fruit produced by an apple tree. Apple trees are cultivated worldwide and are the most widely grown species in the genus Malus. The tree originated in Central Asia, where its wild ancestor, Malus sieversii, is still found today</span>',571),
(609,'Description','<span>The fruit is a large berry that is generally spherical or cylinder in form and about 15&ndash;45 cm (5.9&ndash;17.7 in) long and 10&ndash;30 cm (3.9&ndash;11.8 in) in diameter.</span>',572),
(607,'Description','<span>They\'re rich in beta-carotene, a compound your body changes into&nbsp;</span><b>vitamin A</b><span>, which helps keep your eyes healthy. And beta-carotene helps protect your eyes from the sun and lowers your chances of cataracts and other eye problems. Yellow carrots have lutein, which is also good for your eyes.</span>',570),
(595,'Colocasia ( ARBI ) are filled with nutrients, vitamins, and minerals like fiber, manganese, vitamin B6, vitamin E, potassium, copper, Vitamin C, phosphorus, magnesium.','<ul class=\"i8Z77e\">\r\n<li class=\"TrT0Xe\">Rich in&nbsp;<b>Fiber</b>&nbsp;and Other Important&nbsp;<b>Nutrients</b>.</li>\r\n<li class=\"TrT0Xe\">May Help Control&nbsp;<b>Blood Sugar</b>.</li>\r\n<li class=\"TrT0Xe\">May Reduce Your Risk of&nbsp;<b>Heart Disease</b>.</li>\r\n<li class=\"TrT0Xe\">May Offer Anticancer Properties.</li>\r\n<li class=\"TrT0Xe\">May Help You Lose Weight.</li>\r\n<li class=\"TrT0Xe\">Good for Your Gut.</li>\r\n<li class=\"TrT0Xe\">Versatile and Easy to Add to Your Diet.</li>\r\n</ul>',534),
(661,'As a good source of antioxidant carotenoids, such as lutein and zeaxanthin, yellow corn may promote eye health. It\'s also a rich source of many vitamins and minerals. For this reason, moderate consumption of whole-grain corn, such as popcorn or sweet corn, can be an excellent addition to a healthy diet.','',614),
(671,'Description','<table width=\"962\" cellpadding=\"0\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"613\">\r\n<p>Spinach is rich in&nbsp;<b>vitamins</b>&nbsp;A, C and K,&nbsp;<b>magnesium</b>,&nbsp;<b>iron</b>&nbsp;and manganese. Eating this leafy green veggie may benefit eye health, reduce oxidative stress and reduce&nbsp;<b>blood pressure</b>&nbsp;levels among other health functions. Whether you like it or not, spinach is surely one veggie that you must include in your daily diet.</p>\r\n<div></div>\r\n</td>\r\n</t',623),
(663,'Rich in Micronutrients: Bathua is rich in calcium, potassium, magnesium, and vitamins A, C and B6. All these micronutrients make bathua incredibly nutritious and a winter diet essential.','',615),
(589,'Description','<span>Colloquially, in India, it is called parval or green potato. It is widely cultivated in the eastern and some northern parts of India, particularly in North eastern Andhra, Odisha, Bengal, Assam, Bihar, and Uttar Pradesh. It is used as an ingredient for soup, stew, curry, sweet, or eaten fried and as potoler dorma or dolma (dolma) with fish, roe or meat stuffing. Parval is also used to make Kalonji, a deep fried cuisine filled with spices.</span>',556),
(590,'Description','<span>Calabash, also known as bottle gourd, white-flowered gourd, long melon, New Guinea bean and Tasmania bean is a vine grown for its fruit. It can be either harvested young to be consumed as a vegetable, or harvested mature to be dried and used as a utensil.</span>',557),
(591,'Sponge gourd is quite lower in immersed fats as well as calories. It is contains high amounts of dietary fiber, vitamin C, riboflavin, zinc, thiamine, iron, and magnesium.','Sponge gourd is quite lower in immersed fats as well as calories. It is contains high amounts of dietary fiber, vitamin C, riboflavin, zinc, thiamine, iron, and magnesium.',529),
(594,'Description','<span>Ladies finger is a type of green vegetable, long finger like, having a small tip at the taporing end. Its head shows a bulge, lighter green in shade, which is often removed as inedible portion. The cross section cut okra shows white colored round seeds spread entirely inside the vegetable.</span>',560),
(593,'Description','<span>Most commonly purple, the spongy, absorbent fruit is used in several cuisines. Typically used as a vegetable in cooking, it is a berry by botanical definition. As a member of the genus Solanum, it is related to the tomato and potato. Like the tomato, its skin and seeds can be eaten, but, like the potato, it is usually eaten cooked.</span>',559),
(592,'Description','Sponge gourd is quite lower in immersed fats as well as calories. It is contains high amounts of dietary fiber, vitamin C, riboflavin, zinc, thiamine, iron, and magnesium.',558),
(586,'Description','<span>They\'re rich in beta-carotene, a compound your body changes into&nbsp;</span><b>vitamin A</b><span>, which helps keep your eyes healthy. And beta-carotene helps protect your eyes from the sun and lowers your chances of cataracts and other eye problems. Yellow carrots have lutein, which is also good for your eyes.</span>',553),
(585,'Description','<b>Antioxidants</b><span>.&nbsp;</span><b>Antioxidants</b><span>&nbsp;help protect the body from damaging free radicals that can cause conditions like&nbsp;</span><b>heart disease</b><span>&nbsp;and&nbsp;</span><b>cancer</b><span>. They also protect you against damage from aging and boost your&nbsp;</span><b>immune system</b><span>. Mushrooms are rich in the&nbsp;</span><b>antioxidant</b><span>&nbsp;called&nbsp;</span><b>selenium</b><span>.</span>',552),
(584,'Description','Kiwi is no ordinary fruit, both in terms of the way it looks as well as its nutritional content. The vibrant green slices specked with little black seeds have always worked wonders in sprucing up desserts and fruit bowls. It is a sight for the eyes and the refreshing flavour makes it a favoured choice among fruits.&nbsp;',551),
(583,'Description','Presence of vitamin C, magnesium and potassium content, coconut water makes for a great drink that helps reduce blood pressure levels. Drinking a glass of coconut water daily may actually help get the desired results.',550),
(582,'Description','<span>Rich in fiber and MCTs, it may offer a number of&nbsp;</span><b>benefits</b><span>, including improved heart&nbsp;</span><b>health</b><span>, weight loss, and digestion. Yet, it\'s high in calories and saturated fat, so you should&nbsp;</span><b>eat</b><span>&nbsp;it in moderation. Overall, unsweetened&nbsp;</span><b>coconut</b><span>&nbsp;meat makes a great addition to a balanced&nbsp;</span><b>diet</b><span>.</span>',549),
(581,'Description','Green peas contain a decent amount of heart-healthy minerals, such as magnesium, potassium and calcium. Diets high in these nutrients may be helpful for preventing high blood pressure.',548),
(580,'Description','Guava is usually eaten fresh or made into beverages, while its skin and leaf are used as medicine for treating various diseases. Most people think that guava is associated with a person getting cold and this may be true. Moreover, this fruits also has health benefits. Guava is used to treat dangerous health problems such as high blood pressure, diarrhoea, diabetes, cough and different types of cancer.',547),
(562,'Pumpkins are very versatile in their uses for cooking. Most parts of the pumpkin are edible, including the fleshy shell, the seeds, the leaves, and even the flowers. In the United States and Canada, pumpkin is a popular Halloween and Thanksgiving staple.','',536),
(564,'All parts of the plant are edible, but the fresh leaves and the dried seeds are the parts most traditionally used in cooking, Coriander is used in cuisines throughout the world.','',537),
(566,'Green chillies are definitely more healthy as compared to red chili powder. Green chillies have higher water content and zero calories which makes them a healthy choice for those who are trying to shed some pounds. ','',538),
(603,'Description','<span>Spinach is rich in&nbsp;</span><b>vitamins</b><span>&nbsp;A, C and K,&nbsp;</span><b>magnesium</b><span>,&nbsp;</span><b>iron</b><span>&nbsp;and manganese. Eating this leafy green veggie may benefit eye health, reduce oxidative stress and reduce&nbsp;</span><b>blood pressure</b><span>&nbsp;levels among other health functions. Whether you like it or not, spinach is surely one veggie that you must include in your daily diet.</span>',566),
(569,'One serving of cauliflower contains 77 % of daily recommended value of vitamin C. Cauliflowers are rich in B complex, potassium and manganese. They protect from the risk of heart diseases and brain disorders. It also contains cancer fighting nutrient called sulforaphane.','',540),
(571,'Fresh chard can be used raw in salads, stirfries, soups or omelets. The raw leaves can be used like a tortilla wrap. Chard leaves and stalks are typically boiled or sauteed the bitterness fades with cooking.','',541),
(579,'Description','Kinnows are extremely rich in vitamin C. Vitamin C acts as anti-aging agent. Eating kinnows or drinking kinnow juice regularly can help combat wrinkles due to ageing. Moreover, the minerals present in kinnows not only enhance our overall metabolism but also help us get a flawless and glowing skin.',546),
(574,'Radish actually helps to cleanse our liver and stomach, thus detoxifying it black radish and its leaves have been used for the longest time to treat jaundice because it can get rid of excess bilirubin. And because of that particular property, it also helps to purify our blood. ','',543),
(576,'Pomegranate has anti-oxidant, anti-viral and anti-tumor properties and is said to be a good source of vitamins, especially vitamin A, vitamin C, and vitamin E, as well as folic acid. It contains two compounds – punicalagin and punicic acid which give it all the potent benefits.','',544),
(578,'Sweet lime is served as juice. The vitamin C in sweet lime not only protects one against colds and coughs but also increases the body’s fat burning capacity. According to the Journal of the American College of Nutrition, people with adequate vitamin C oxidase 30 percent faster during workouts than those with a low level.','',545),
(605,'Description','<span>Green peas contain a decent amount of heart-healthy minerals, such as magnesium, potassium and calcium. Diets high in these nutrients may be helpful for preventing high blood pressure.</span>',568),
(606,'Description','<br />\r\n<table id=\"multicitybooking\" class=\"table table-bordered table-condensed table-hover table-striped\">\r\n<tbody>\r\n<tr>\r\n<td><b>Antioxidants</b><span>.&nbsp;</span><b>Antioxidants</b><span>&nbsp;help protect the body from damaging free radicals that can cause conditions like&nbsp;</span><b>heart disease</b><span>&nbsp;and&nbsp;</span><b>cancer</b><span>. They also protect you against damage from aging and boost your&nbsp;</span><b>immune system</b><span>. Mushrooms are rich in the&nbsp;</spa',569),
(604,'Description','<span>Radish actually helps to cleanse our liver and stomach, thus detoxifying it black radish and its leaves have been used for the longest time to treat jaundice because it can get rid of excess bilirubin. And because of that particular property, it also helps to purify our blood.</span>',567),
(596,'Description','<span>Colocasia ( ARBI ) are filled with nutrients, vitamins, and minerals like fiber, manganese, vitamin B6, vitamin&nbsp;E, potassium, copper, Vitamin C, phosphorus, magnesium.</span>',561),
(598,'Description','<br />\r\n<table id=\"multicitybooking\" class=\"table table-bordered table-condensed table-hover table-striped\">\r\n<tbody>\r\n<tr>\r\n<td>Capsicum is a genus of flowering plants in the nightshade family Solanaceae. Its species are native to the Americas, where they have been cultivated for thousands of years. Capsicums are cultivated worldwide and used in many cuisines.</td>\r\n</tr>\r\n</tbody>\r\n</table>',562),
(599,'Description','<span>Pumpkins are very versatile in their uses for cooking. Most parts of the pumpkin are edible, including the fleshy shell, the seeds, the leaves, and even the flowers. In the United States and Canada, pumpkin is a popular Halloween and Thanksgiving staple.</span>',563),
(640,'Description','<span>Singhara is rich in carbohydrate, fibre, vitamins and minerals. They are crispy and crunchy. It is usually eaten raw or sometimes cooked into various dishes to reap its benefits.&nbsp;</span>',600),
(641,'Description','<span>Round gourd is regarded as super food for its numerous health benefits. It contains antioxidants like carotenoids and many anti-inflammatory agents, which help controlling blood pressure, heart diseases, and strokes and prevents cancer formation. It is very mild and soothing vegetable for intestinal tract. It contains a lot of fiber that helps in digestion and diarrhea. It also increases the urinary flow and excretes toxins from the kidney and is very effective in prevention of prostate ca',601),
(601,'Description','<br />\r\n<table id=\"multicitybooking\" class=\"table table-bordered table-condensed table-hover table-striped\">\r\n<tbody>\r\n<tr>\r\n<td>Fresh chard can be used raw in salads, stirfries, soups or omelets. The raw leaves can be used like a tortilla wrap. Chard leaves and stalks are typically boiled or sauteed the bitterness fades with cooking.</td>\r\n</tr>\r\n</tbody>\r\n</table>',565),
(602,'Spinach is rich in vitamins A, C and K, magnesium, iron and manganese. Eating this leafy green veggie may benefit eye health, reduce oxidative stress and reduce blood pressure levels among other health functions. Whether you like it or not, spinach is surely one veggie that you must include in your daily diet.','',542),
