(557,'Ladies finger is a type of green vegetable, long finger like, having a small tip at the taporing end. Its head shows a bulge, lighter green in shade, which is often removed as inedible portion. The cross section cut okra shows white colored round seeds spread entirely inside the vegetable. ','',533),
(627,'Description','<span>Cabbage has 1 gram of fiber for every 10&nbsp;</span><b>calories</b><span>. That helps fill you up, so you eat less. It also keeps you regular, and it could help lower your &ldquo;bad&rdquo; (LDL)&nbsp;</span><b>cholesterol</b><span>&nbsp;and control your blood sugar. Cabbage also has&nbsp;</span><b>nutrients</b><span>&nbsp;that keep the lining of your stomach and intestines strong.</span>',588),
