(541,'Apple is an edible fruit produced by an apple tree. Apple trees are cultivated worldwide and are the most widely grown species in the genus Malus. The tree originated in Central Asia, where its wild ancestor, Malus sieversii, is still found today','',524),
(543,'The fruit is a large berry that is generally spherical or cylinder in form and about 15–45 cm (5.9–17.7 in) long and 10–30 cm (3.9–11.8 in) in diameter.','',525),
(545,'A wide variety of health benefits are associated with the curvy yellow fruit. Bananas are high in potassium and pectin, a form of fiber, said Laura Flores, a San Diego-based nutritionist. They can also be a good way to get magnesium and vitamins C and B6.','',526),
(610,'Description','<span>A wide variety of health benefits are associated with the curvy yellow fruit. Bananas are high in potassium and pectin, a form of fiber, said Laura Flores, a San Diego-based nutritionist. They can also be a good way to get magnesium and vitamins C and B6.</span>',573),
(611,'Description','<span>Pomegranate has anti-oxidant, anti-viral and anti-tumor properties and is said to be a good source of vitamins, especially vitamin A, vitamin C, and vitamin E, as well as folic acid. It contains two compounds &ndash; punicalagin and punicic acid which give it all the potent benefits.</span>',574),
(659,'Description','',613),
(648,'Oranges are a healthy source of fiber, vitamin C, thiamine, folate, and antioxidants. They have multiple health benefits.','',607),
(650,'Available as a dietary supplement, ivy gourd is said to have potent anti-inflammatory and antioxidant effects that may aid in the prevention or treatment of a diverse range of health conditions, from diabetes and high cholesterol to high blood pressure and obesity.','',608),
(652,'Mustard greens are rich in important plant compounds and micronutrients, specifically vitamins A, C, and K. As a result, eating them may have benefits for eye and heart health, as well as anticancer and immune-boosting properties.','',609),
(654,'One of the most unique aspects of fenugreek benefits is that, is a very useful herb in any form – powdered, seeds, dried leaves and as a vegetable.  Apart from being used in methi paratha (fresh leaves) or as a spice (kasuri methi), fenugreek benefits many cosmetic and health purposes.','',610),
(614,'Description','<span>Guava is usually eaten fresh or made into beverages, while its skin and leaf are used as medicine for treating various diseases. Most people think that guava is associated with a person getting cold and this may be true. Moreover, this fruits also has health benefits. Guava is used to treat dangerous health problems such as high blood pressure, diarrhoea, diabetes, cough and different types of cancer.</span>',577),
(615,'Description','<span>Rich in fiber and MCTs, it may offer a number of&nbsp;</span><b>benefits</b><span>, including improved heart&nbsp;</span><b>health</b><span>, weight loss, and digestion. Yet, it\'s high in calories and saturated fat, so you should&nbsp;</span><b>eat</b><span>&nbsp;it in moderation. Overall, unsweetened&nbsp;</span><b>coconut</b><span>&nbsp;meat makes a great addition to a balanced&nbsp;</span><b>diet</b><span>.</span>',578),
(616,'Description','<span>Presence of vitamin C, magnesium and potassium content, coconut water makes for a great drink that helps reduce blood pressure levels. Drinking a glass of coconut water daily may actually help get the desired results.</span>',579),
(617,'Description','<span>Kiwi is no ordinary fruit, both in terms of the way it looks as well as its nutritional content. The vibrant green slices specked with little black seeds have always worked wonders in sprucing up desserts and fruit bowls. It is a sight for the eyes and the refreshing flavour makes it a favoured choice among fruits.&nbsp;</span>',580),
(618,'Description','<span>The onion also known as the bulb onion or common onion, is a vegetable that is the most widely cultivated species of the genus Allium. Its close relatives include the garlic, scallion and Chinese onion.</span>',581),
