(637,'Description','<span>Sweet potatoes are a rich source of fibre as well as containing an array of&nbsp;</span><b>vitamins and minerals</b><span>&nbsp;including iron, calcium, selenium, and they\'re a good source of most of our B&nbsp;</span><b>vitamins</b><span>&nbsp;and&nbsp;</span><b>vitamin C</b><span>.</span>',597),
(634,'Description','<span>Most commonly purple, the spongy, absorbent fruit is used in several cuisines. Typically used as a vegetable in cooking, it is a berry by botanical definition. As a member of the genus Solanum, it is related to the tomato and potato. Like the tomato, its skin and seeds can be eaten, but, like the potato, it is usually eaten cooked.</span>',594),
(635,'Description','<span>Most commonly purple, the spongy, absorbent fruit is used in several cuisines. Typically used as a vegetable in cooking, it is a berry by botanical definition. As a member of the genus Solanum, it is related to the tomato and potato. Like the tomato, its skin and seeds can be eaten, but, like the potato, it is usually eaten cooked.</span>',595),
(636,'Description','<span>One serving of cauliflower contains 77 % of daily recommended value of vitamin C. Cauliflowers are rich in B complex, potassium and manganese. They protect from the risk of heart diseases and brain disorders. It also contains cancer fighting nutrient called sulforaphane.</span>',596),
(638,'Description','<ul class=\"i8Z77e\">\r\n<li class=\"TrT0Xe\">Rich in&nbsp;<b>Nutrients</b>. Share on Pinterest.</li>\r\n<li class=\"TrT0Xe\">May Improve&nbsp;<b>Irritable Bowel Syndrome</b>.&nbsp;<b>Irritable bowel syndrome</b>&nbsp;(IBS) is a common digestive tract disorder.</li>\r\n<li class=\"TrT0Xe\">May Help Relieve Indigestion.</li>\r\n<li class=\"TrT0Xe\">Could Improve&nbsp;<b>Brain</b>&nbsp;Function.&nbsp;</li>\r\n<li class=\"TrT0Xe\">May Decrease&nbsp;<b>Breastfeeding</b>&nbsp;Pain.</li>\r\n<li class=\"TrT0Xe\">Subjectively Im',598),
(639,'Description','<span>Bitter gourd is a rich source of&nbsp;</span><b>vitamins</b><span>&nbsp;and minerals. It contains iron, magnesium,&nbsp;</span><b>potassium</b><span>&nbsp;and&nbsp;</span><b>vitamins</b><span>&nbsp;like A and C. It contains twice the calcium of spinach and beta-carotene of broccoli. Various anti-oxidants and anti-inflammatory compounds are present in bitter gourd.</span>',599),
(642,'Description','<ul>\r\n<li>Fresh broad beans have high levels of&nbsp;<span>vitamin C and B group vitamins</span>, as well as&nbsp;<span>potassium, iron and magnesium</span>. They also are replete with&nbsp;<span>polyphenols</span>&nbsp;that have strong&nbsp;<span>antioxidant</span>&nbsp;properties and protect us against&nbsp;<span>free radicals</span>.</li>\r\n</ul>',602),
(643,'Description','Cluster beans helps you in weight managment, blood circulation, blood pressure, even diabetes patients can also get various benefits.',603),
(644,'Description','<span>Broccoli is a good carb and is high in&nbsp;</span><b>fiber</b><span>, which aids in&nbsp;</span><b>digestion</b><span>, prevents&nbsp;</span><b>constipation</b><span>, maintains low&nbsp;</span><b>blood sugar</b><span>, and curbs overeating. Along with this, broccoli is also great for weight loss because it is rich in&nbsp;</span><b>fiber</b><span>.</span>',604),
(645,'Description','<span>Papaya is excellent for weight loss because of its low calorie count. Because the fruit is also a good source of fiber, papaya isn&rsquo;t only physically satisfying &mdash; it&rsquo;ll also help you stay full longer. As a result, you may end up consuming fewer calories throughout the day.</span>',605),
(646,'Description','Green bananas have vitamins and minerals such as potassium, vitamin C and Vitamin B6 which facilitates the absorption of minerals and nutrients such as calcium. Vitamin C is crucial for maintaining healthy skin and hair. It enhances immunity and encompasses antioxidants that prevent free radical damage. Vitamin B6 helps to convert food into energy. It is beneficial for heart health and promotes brain function.',606),
(656,'Spring onions are an excellent source of vitamin C and calcium. They are also a good source of dietary fibre and vitamins A and B6, thiamine, folate and minerals (potassium, copper, chromium, manganese, iron).','',611),
(658,'Capsicums are an excellent source of vitamin A and C (red contain more than green capsicums). They are also a good source of dietary fibre, vitamin E, B6 and folate. The sweetness of capsicums is due to their natural sugars (green capsicums have less sugar than red capsicums).','',612),
(672,'Description','<p>Mustard greens are rich in\r\nimportant plant compounds and micronutrients, specifically vitamins A, C, and\r\nK. As a result, eating them may have benefits for eye and heart health, as well\r\nas anticancer and immune-boosting properties.</p>\r\n<span style=\"white-space: pre;\">	</span>',624),
