(674,'Description','<p><b>Dill leaves</b> is a green, leafy vegetable that is loaded with\r\nvarious nutrients like calcium, magnesium, iron and flavonoids. Commonly used\r\nin soups, salads, pickles and other dishes, this leafy vegetable has a unique\r\ntaste and a distinct flavour.</p>\r\n<span style=\"white-space: pre;\">	</span>',626),
