(679,'Amla benefits include antibacterial & astringent properties which help improve the body\'s immunity system. Indian Gooseberry also increases white blood cells which help flush out the toxins from the body.','',630),
(681,'Jackfruit is infused with a diverse set of vitamins such as vitamin C and A, thiamin, niacin, riboflavin, calcium, potassium (with 303 mg found per 100 g), iron, zinc, sodium and folic acid. It is one of the few trees rich in B-complex group vitamins as well as vitamin B6. It contains phytonutrient properties such as anti-cancer, anti-hypertensive, anti-ulcer and anti-inflammatories. It’s a rich source of phytonutrients and phenolics. It contains minerals, fiber, protein, and is free of fats and','',631),
